import "../style/App.scss";
import RandomCat from "./RandomCat";
import React from "react";

class App extends React.Component {
  render() {
    return (
      <div className='App'>
        <RandomCat />
        <section className='section-cats'>
          <h1>All Cats Are Beautiful</h1>
          <ul className='section-cats_list'>
            <li>A cat</li>
            <li>Another cat</li>
            <li>Moar cat</li>
          </ul>
        </section>
      </div>
    );
  }
}

export default App;
